import React from 'react';
import ReactDOM from 'react-dom';

const APP = () => {
  return (
    <div>
      <h3>Cocoa</h3>
    </div>
  )
}

ReactDOM.render(
  <React.StrictMode>
    <APP />
  </React.StrictMode>,
  document.getElementById('root')
);

